import React from 'react';
import Button from '@material-ui/core/Button';
import img from './images/home-slider.png';


const Contact = () => {
    return(
        <>
        <div className="row">
        <div className="col-md-1"></div>
        <div className="col-md-10">
        <div className="col-md-6 slider pt-5 pt-lg-0 order-2 order-lg-1">
            <h1>Grow your Business with <strong>React Solution</strong></h1>
            <p>We are the team of talented developer making websites</p>
            <Button variant="outlined" className="slider_button">
            Get Started
            </Button>
         </div>
        
         <div className="col-md-6 d-flex align-items-end">
            <img src={img} className="img-fluid home-slider-img"/>
         </div>
         </div>
         <div className="col-md-1"></div>
         </div>
         
        </>
    );
}

export default Contact;
